import * as React from 'react';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import { City } from '../models/City'; // Импортируем City
import { Government } from '../models/Government'; // Импортируем Government

interface ButtonsProps {
  inputValue: string;
  onCityUpdate: (city: City) => void; 
}

const GetCityButton: React.FC<ButtonsProps> = ({ inputValue, onCityUpdate }) => {
  const handleButtonClick = async () => {
    try {
      const response = await fetch(`http://localhost:9991/api/city/${inputValue}`);
      if (!response.ok) {
        throw new Error('Network response was not ok');
      }
      const xmlText = await response.text(); // Получите ответ в текстовом формате
      const parser = new DOMParser();
      const xmlDoc = parser.parseFromString(xmlText, "text/xml"); // Парсим XML

      // Извлечение данных из XML и создание объекта city с использованием интерфейса City
      const city: City = {
        id: xmlDoc.getElementsByTagName("id")[0]?.textContent || '',
        name: xmlDoc.getElementsByTagName("name")[0]?.textContent || '',
        coordinates: {
          x: xmlDoc.getElementsByTagName("x")[0]?.textContent || '',
          y: xmlDoc.getElementsByTagName("y")[0]?.textContent || '',
        },
        creationDate: new Date(xmlDoc.getElementsByTagName("creationDate")[0]?.textContent || ''),
        area: xmlDoc.getElementsByTagName("area")[0]?.textContent || '',
        population: xmlDoc.getElementsByTagName("population")[0]?.textContent || '',
        metersAboveSeaLevel: xmlDoc.getElementsByTagName("metersAboveSeaLevel")[0]?.textContent || '',
        establishmentDate: new Date(xmlDoc.getElementsByTagName("establishmentDate")[0]?.textContent || ''),
        capital: xmlDoc.getElementsByTagName("capital")[0]?.textContent === 'true',
        government: xmlDoc.getElementsByTagName('government')[0]?.textContent as Government || Government.DESPOTISM,
        //government: xmlDoc.getElementsByTagName("government")[0]?.textContent as Government,
        governor: {
          height: xmlDoc.getElementsByTagName("height")[0]?.textContent || '',
          birthday: new Date(xmlDoc.getElementsByTagName("birthday")[0]?.textContent || ''),
        },
      };

      // Передаем полученный объект обратно в TableCity или другой компонент
      onCityUpdate(city);
    } catch (error) {
      console.error('Error fetching city data:', error);
    }
  };


  return (
    <Stack direction="row" spacing={2}>
      <Button variant="outlined" onClick={handleButtonClick}>Получить город</Button>
    </Stack>
  );
}
export default GetCityButton;
